import React, { useState, useEffect } from 'react';
import axios from 'axios';
import Spinner from 'react-bootstrap/Spinner';
import Jumbotron from 'react-bootstrap/Jumbotron';
import Form from 'react-bootstrap/Form';
import Button from 'react-bootstrap/Button';
import { withRouter } from 'react-router-dom';

function CreateReward(props) {
  const [reward, setReward] = useState({ documentId: '', brand: '', cost: '', hasStock: '', 
                id: '',img_url: '', value: '' });
  const [showLoading, setShowLoading] = useState(false);
  const apiUrl = "https://localhost:44348/api/rewards";

  const saveReward = (e) => {
    setShowLoading(true);
    e.preventDefault();
    const data = { brand: reward.brand, cost: reward.cost, 
      hasStock: reward.hasStock, id: reward.id, img_url: reward.img_url, value: reward.value};
    axios.post(apiUrl, data)
      .then((result) => {
        setShowLoading(false);
        props.history.push('/showreward/' + result.data.documentId)
      }).catch((error) => setShowLoading(false));
  };

  const onChange = (e) => {
    e.persist();
    setReward({...reward, [e.target.name]: e.target.value});
  }

  return (
    <div>
      {showLoading && 
        <Spinner animation="border" role="status">
          <span className="sr-only">Loading...</span>
        </Spinner> 
      } 

      <Jumbotron>
      <h2 style={{textAlign: 'center'}}>Create New Reward</h2>
        <Form onSubmit={saveReward}>
          <Form.Group style={{width: 800, marginLeft: 350}}>
            <Form.Label> Brand</Form.Label>
            <Form.Control style={{marginLeft: 80, marginTop: -30}} type="text" name="brand" id="brand" placeholder="Enter brand name" value={reward.brand} onChange={onChange} />
          </Form.Group>
          <Form.Group style={{width: 800, marginLeft: 350}}>
            <Form.Label> Cost</Form.Label>
            <Form.Control type="text" name="cost" id="cost" placeholder="Enter cost" value={reward.cost} onChange={onChange} />
          </Form.Group>
          <Form.Group style={{width: 800, marginLeft: 350}}>
            <Form.Label> Has Stock?</Form.Label>
            <Form.Control type="text" name="hasStock" id="hasStock" placeholder="Enter true or false" value={reward.hasStock} onChange={onChange} />
          </Form.Group>
          <Form.Group style={{width: 800, marginLeft: 350}}>
            <Form.Label> ID</Form.Label>
            <Form.Control type="text" name="id" id="id" placeholder="Enter id" value={reward.id} onChange={onChange} />
          </Form.Group>
          <Form.Group style={{width: 800, marginLeft: 350}}>
            <Form.Label> Image URL</Form.Label>
            <Form.Control type="text" name="img_url" id="img_url" placeholder="Enter image url" value={reward.img_url} onChange={onChange} />
          </Form.Group>
          <Form.Group style={{width: 800, marginLeft: 350}}>
            <Form.Label>Value</Form.Label>
            <Form.Control type="text" name="value" id="value" placeholder="Enter value" value={reward.value} onChange={onChange} />
          </Form.Group>


          <Button variant="primary" type="submit" style={{width: 800, marginLeft: 350}}>
            Save Reward
          </Button>
        </Form>
      </Jumbotron>
    </div>
  );
}

export default withRouter(CreateReward);
